import React from 'react'
import { Redirect, Route } from 'react-router'

export const PrivateRoutes = ({
    someCheckpoint,
    component: Component,
    
}) => {
    return (
        <Route 
            component={ ( props ) => (
                ( someCheckpoint )
                    ? <Component { ...props } />
                    : <Redirect to="./" />
            )}
        />
    )
}
